import React from 'react'
import {connect} from 'react-redux';
 function SearchElement({products,name}) {
    return (
        <div>
            {name}
        </div>
    )
}
const mapStateToProps=state=>{
    return{
        products:state.trade.products
    }
    
}
export default connect(mapStateToProps)(SearchElement);
